import React, { Component } from 'react';
import { Link } from 'react-router-dom'
import { Button } from 'antd';
import qs from 'qs'
import API from '@/axios/api_task'
import styles from './styles/index.module.less';


const R = {
  avatar:"https://gimg2.baidu.com/image_search/src=http%3A%2F%2Fww3.sinaimg.cn%2Fmw690%2F001M3Mcbly1gjvrsyggztj61tm1tr15q02.jpg&refer=http%3A%2F%2Fwww.sina.com&app=2002&size=f9999,10000&q=a80&n=0&g=0n&fmt=jpeg?sec=1615360296&t=3dc56c54c1eadc6e08e5d0fc085b631a",
  position:'前端工程师',
  workExperience:3,
}

class Datasets extends Component {
  render() {  
    return (
      <div className={styles.resumeWrap}>
        <div className={styles.resumeLeft}>
          <div className={styles.avatarWrap}>
            <img className={styles.avatar} src={R.avatar} /> 
            <div className={styles.name}>南宫夏</div>
            <div className={styles.position}>{R.position}<span className={styles.workExperience}> ({R.workExperience}年经验)</span></div>
          </div>

          <div className={styles.personalInfo}> 
            <div className={styles.title}>基本信息</div>
            <div className={styles.line}></div>
            <i class="iconfont icon-shengrihuiyuan"></i>
            <i class="iconfont">&#xe60d;</i>

          </div>

        </div>
        <div className={styles.resumeRight}>
          22222
        </div>
        {/* <Link to="/example">
          <Button className={styles.btn} type="primary">Example</Button> 
        </Link> */}

      </div>
    );
  }
}


export default Datasets;
